import React, { useState } from 'react';
import '/Users/rishabhkamal/Desktop/React-Car-Rental-Website/src/styles/Login.css'; // Import the CSS file

const Login = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Here, you can perform your login logic

    setUsername('');
    setPassword('');
  };

  return (
    <div className="login-container"> {/* Apply the CSS class */}
      <div className="login-form"> {/* Add a container for the login form */}
        <h2>Login</h2>
        <form onSubmit={handleSubmit}>
          <label>
            Username:
            <input
              type="text"
              value={username}
              onChange={(e) => setUsername(e.target.value)}
            />
          </label>
          <br />
          <label>
            Password:
            <input
              type="password"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
          </label>
          <br />
          <button type="submit">Submit</button>
        </form>
      </div>
    </div>
  );
};

export default Login;
